export const APP_ACTIONS = {
  onSignInEmailChange: "ON_EMAIL_CHANGE",
  onSignInPasswordChange: "ON_PASSWORD_CHANGE",
};

export const onEmailChange = (event) => {
  return {
    type: APP_ACTIONS.onEmailChange,
  };
};
